scwin.homeSearchBox_onkeydown = function (e) {
    if ((e.charCode || e.keyCode) === 13) {
        
        var rowJSON = {
            "name": homeSearchBox.getValue()
        };

        // 새로 열릴 화면에 데이터를 전달 (dataObject를 통해 전달 가능)
        var obj = {
            "dataObject": {
                "type": "json",
                "name": "HomeSearch",
                "data": rowJSON
            }
        };
	
        $p.parent().wfmRightContents.setSrc("/page/subpage/SystemSearch.xml", obj);
    }
};

scwin.grdUnitTasks_oncellclick = function (rowIndex, columnIndex, columnId) {
    const id = unitTasks.getCellData(rowIndex, "unitAfrsId");
    const name = unitTasks.getCellData(rowIndex, "manlName");

    var rowJSON = {
        "id": id,
        "name": name
    };

    var dataObject = {
        "type": "json",
        "name": "PopupData",
        "data": rowJSON
    };

    $c.util.openEamsPopup("/page/component/search/SystemSearchResultBizDetail.xml", "업무 상세", dataObject);
};

